之前跟洛酱聊过之后就蛮想要wp那样的地区统计的，然后找到了插件。
注册在ClustrMaps注册登录，登记博客地址。
选择组件类型有map（平面）和global（立体）两种，选择平面。
自定义图像格式调整底色等。
生成代码嵌入博客添加主题配置打开你的主题的yml文件。
# 侧边栏aside:   # 添加以下字段  card_maps: true
插入地图打开themes&#x2F;你的主题名&#x2F;layout&#x2F;includes&#x2F;aside.pug。
block aside-block # 在侧边栏block后加入代码if theme.aside.card_maps          span= _p(&#x27;&#x27;)        a(href=url_for(&#x27;你的博客url&#x27;))          img(src=url_for(&#x27;生成代码中的src字段&#x27;))

